import React from "react";

const RoacketsItems = (props) => {
  return (
    <div>
      <div className="card my-3 mb-0 text-start mb-0 bg-dark text-warning">
        <img
          src={props.image}
          className="card-img-top img-thumbnail bg-dark"
          alt="..."
          style={{ width: "500px", height: "270px" }}
        />
        <div className="card-body">
          <h5 className="card-title">{props.name}</h5>
          <h6 className="card-title">{props.fullName.slice(0, 10)}...</h6>

          <p className="card-text">{props.description.slice(0, 50)}...</p>
          <div className="card-body mb-0">
            <Link key={props.id} to={props.id} className="btn btn-outline-warning">
              Read More
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
};

export default RoacketsItems;
